import React, {useState} from 'react'
import './Navbar.css';
import DehazeIcon from '@material-ui/icons/Dehaze';
import {Link } from 'react-router-dom';
import {useDispatch} from 'react-redux';
import {Navbar_Solution_False,Navbar_Solution_True} from '../../actions/Seller.js';
const Navbar = () => {


    const [showLinks, setShowLinks] = useState(true);
    const dispatch = useDispatch();
    const [user,setUser] = useState(JSON.parse(localStorage.getItem('profile')))
    if(showLinks === true)
    {
        dispatch(Navbar_Solution_True);
    }
    else
    {
        dispatch(Navbar_Solution_False);
    }

    return (
        <div className='Navbar'>
            <div className='leftSide'>
                <div className='links' id={showLinks ? "hidden" : ""}>
                <a><Link to='/'>Home</Link></a>
                <a><Link to='/customer'>Customer</Link></a>
                <a><Link to='/seller'>Seller</Link></a>
                </div>
                <button onClick={() => setShowLinks(!showLinks)}><DehazeIcon/></button>
            </div>
            <div className='rightSide'>
                {user ? <div className='links_right'>
                    <a><button>Logout</button></a>
                </div>

                :
                <div className='links_right'>
                <a><Link to ='/'>Login</Link></a>
                <a><Link to ='/'>Signin</Link></a>
                </div>

            }


            </div>
        </div>
    )
}

export default Navbar
